import React from 'react';
import AppLayout from '../components/Applayout';
import { Carousel } from 'antd';

const Main = () => {
  return (
    <AppLayout>
      <Carousel autoplay>
        <div>
          <h3>1</h3>
        </div>
        <div>
          <h3>2</h3>
        </div>
        <div>
          <h3>3</h3>
        </div>
        <div>
          <h3>4</h3>
        </div>
      </Carousel>
    </AppLayout>
  );
};

export default Main;
